import Buttons from './Buttons'

const Header = ({currPage,setCurrPage}) => {
  return (
    <header>
        <Buttons
            currPage = {currPage}
            buttonText="Users"
            setCurrPage = {setCurrPage}
        /> 
        <Buttons
            currPage = {currPage}
            buttonText="Posts"
            setCurrPage = {setCurrPage}
        /> 
        <Buttons
            currPage = {currPage}
            buttonText="Comments"
            setCurrPage = {setCurrPage}
        /> 
    </header>
  )
}

export default Header
